export default function Filter() {
    return(
        <>
        <div id="sidebar" class="sidenav">
        <button class="filter_btn" onClick={()=>FilterScript()}>Filter ></button>
            <ul id="sidemenu">
                <li><input id="search" type="text" name="search" placeholder="Suche..."/></li>
                <li>
                    <h3 id="filterHeader">Filter</h3>
                </li>

            </ul>
        </div>
        </>
    );
}

function FilterScript() {
    document.querySelector('.filter_btn').classList.toggle('is-active');
    document.querySelector('#sidebar').classList.toggle('is-active');
    document.querySelector('#outer_frame').classList.toggle('is-active');

    document.querySelector('.filter_btn').firstChild.data = document.querySelector('.filter_btn').firstChild.data == "<" ? "Filter >" : "<";
}
